438\u0433\u0440\u044b, \u0432\u044b\u0438\u0433\u0440\u0430\u0432 \u0441\u0435\u0440\u0438\u044e \u0438\u0433\u0440 6:5).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973<\/a><ul><li>\u041e\u0442\u043c\u0435\u043d\u0435\u043d\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0426\u041a \u041a\u041f\u0423 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u043d\u0430 \u043e\u0441\u0442\u0440\u043e\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D1%80%D1%82%D0%B8%D1%86%D0%B0\" title=\"\u0425\u043e\u0440\u0442\u0438\u0446\u0430\">\u0425\u043e\u0440\u0442\u0438\u0446\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%BE%D1%80%D0%BE%D0%B6%D1%8C%D0%B5\" title=\"\u0417\u0430\u043f\u043e\u0440\u043e\u0436\u044c\u0435\">\u0417\u0430\u043f\u043e\u0440\u043e\u0436\u044c\u0435<\/a> \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a\u0430.<\/li><li>\u0412 \u043d\u0435\u0431\u043e\u0441\u043a\u0440\u0451\u0431\u0435 \u043b\u0430\u0442\u0438\u043d\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/ITT_Corporation\" title=\"ITT Corporation\">ITT Corporation<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8D%D0%B4%D0%B8%D1%81%D0%BE%D0%BD-%D0%B0%D0%B2%D0%B5%D0%BD%D1%8E\" title=\"\u041c\u044d\u0434\u0438\u0441\u043e\u043d-\u0430\u0432\u0435\u043d\u044e\">\u041c\u044d\u0434\u0438\u0441\u043e\u043d-\u0430\u0432\u0435\u043d\u044e<\/a> \u0431\u044b\u043b\u0430 \u0432\u0437\u043e\u0440\u0432\u0430\u043d\u0430 \u0431\u043e\u043c\u0431\u0430 \u0432 \u0437\u043d\u0430\u043a \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430 \u043f\u0440\u043e\u0442\u0438\u0432 \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u043a