u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0441\u044f \u0422\u0443\u0448\u0438\u043d\u0441\u043a\u0438\u043c \u043f\u043e\u0431\u043e\u0438\u0449\u0435\u043c \u0438\u0437-\u0437\u0430 \u0438\u0437\u0431\u0438\u0435\u043d\u0438\u044f \u0442\u043e\u043b\u043f\u044b \u0444\u0430\u043d\u0430\u0442\u043e\u0432 \u043c\u0438\u043b\u0438\u0446\u0435\u0439\u0441\u043a\u0438\u043c\u0438 \u0441\u0438\u043b\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%81%D1%82%D0%BE%D0%BD%D0%B8%D1%8F_(%D0%BF%D0%B0%D1%80%D0%BE%D0%BC)\" title=\"\u042d\u0441\u0442\u043e\u043d\u0438\u044f (\u043f\u0430\u0440\u043e\u043c)\">\u041f\u0430\u0440\u043e\u043c \u00ab\u042d\u0441\u0442\u043e\u043d\u0438\u044f\u00bb<\/a> \u0437\u0430\u0442\u043e\u043d\u0443\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u043e\u0435 \u043c\u043e\u0440\u0435\">\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u043e\u043c \u043c\u043e\u0440\u0435<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 852 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000_%D0%B3%D0%BE%D0%B4\" title=\"2000 \u0433\u043e\u0434\">2000<\/a>&#160;\u2014 \u0418\u0437\u0440\u0430\u0438\u043b\u044c\u0441\u043a\u0438\u0439 \u043f\u0440\u0435\u043c\u044c\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D0%B0%D0%BA,_%D0%AD%D1%85%D1%83%D0%B4\" title=\"\u0411\u0430\u0440\u0430\u043a, \u042d\u0445\u0443\u0434\">\u042d\u0445\u0443\u0434 \u0411\u0430\u0440\u0430\u043a<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0438\u0437\u043d\u0430\u043b \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u0440\u0430\u0437\u0434\u0435\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC\" title=\"\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\">\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0430<\/a>. \u041f\u043e \u0435\u0433\u043e \u0441\u043b\u043e\u0432\u0430\u043c, \u043c\u0438\u0440\u043d\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u0441 \u043f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0446\u0430\u043c\u0438, \u0435\u0441\u043b\u0438 \u043e\u043d\u043e \u0431\u0443\u0434\u0435\u0442 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u043e, \u0431\u0443\u0434\u0435\u0442 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0442\u044c \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0451\u043d\u043d\u043e\u0441\u0442\u044c \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u0433\u043e\u0440\u043e\u0434\u0430 \u043e\u0441\u0442\u0430\u0451\u0442\u0441\u044f \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 \u0418\u0437\u0440\u0430\u0438\u043b\u044f, \u0430 \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f&#160;\u2014 \u0441\u0442\u0430\u043d\u0435\u0442 \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XXI_%D0%B2%D0%B5%D0%BA\" title=\"XXI \u0432\u0435\u043a\">XXI \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2001_%D0%B3%D0%BE%D0%B4\" title=\"2001 \u0433\u043e\u0434\">2001<\/a>&#160;\u2014 \u0411\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u0438\u0439 \u043f\u0438\u043b\u043e\u0442 46-\u043b\u0435\u0442\u043d\u0438\u0439 \u0416\u0435\u0440\u0430\u0440\u0434 \u041c\u043e\u0441 (Gerard Moss), \u043f\u0440\u0438\u0437\u0435\u043c\u043b\u0438\u0432\u0448\u0438\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BE-%D0%B4%D0%B5-%D0%96%D0%B0%D0%BD%D0%B5%D0%B9%D1%80%D0%BE\" title=\"\u0420\u0438\u043e-\u0434\u0435-\u0416\u0430\u043d\u0435\u0439\u0440\u043e\">\u0420\u0438\u043e-\u0434\u0435-\u0416\u0430\u043d\u0435\u0439\u0440\u043e<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f\">\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f<\/a>), \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 \u043c\u043e\u0442\u043e\u0440\u043d\u043e\u043c \u043f\u043b\u0430\u043d\u0435\u0440\u0435 Ximango (\u0428\u0438\u043c\u0430\u043d\u0433\u0443), \u0434\u043b\u0438\u0432\u0448\u0438\u0439\u0441\u044f 100 \u0434\u043d\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2003_%D0%B3%D0%BE%D0%B4\" title=\"2003 \u0433\u043e\u0434\">2003<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B1%D0%BE%D0%B9_%D1%8D%D0%BD%D0%B5%D1%80%D0%B3%D0%BE%D1%81%D0%B5%D1%82%D0%B8_%D0%B2_%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D0%B8_(2003)\" class=\"mw-redirect\" title=\"\u0421\u0431\u043e\u0439 \u044d\u043d\u0435\u0440\u0433\u043e\u0441\u0435\u0442\u0438 \u0432 \u0418\u0442\u0430\u043b\u0438\u0438 (2003)\">\u0421\u0431\u043e\u0439 \u044d\u043d\u0435\u0440\u0433\u043e\u0441\u0435\u0442\u0438 \u0432 \u0418\u0442\u0430\u043b\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%B8%D0%B8_(2008)\" title=\"\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438