ss=\"mw-redirect\" title=\"\u042e\u0440\u0438\u0439 \u041b\u0443\u0436\u043a\u043e\u0432\">\u042e\u0440\u0438\u044f \u041b\u0443\u0436\u043a\u043e\u0432\u0430<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2013_%D0%B3%D0%BE%D0%B4\" title=\"2013 \u0433\u043e\u0434\">2013<\/a>&#160;\u2014 \u0427\u043b\u0435\u043d\u044b \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0418\u0442\u0430\u043b\u0438\u0438, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u0435 \u043f\u0430\u0440\u0442\u0438\u044e \u00ab\u041d\u0430\u0440\u043e\u0434 \u0441\u0432\u043e\u0431\u043e\u0434\u044b\u00bb, \u043f\u043e\u0434\u0430\u043b\u0438 \u0432 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0443 \u0432 \u0437\u043d\u0430\u043a \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430 \u043f\u0440\u043e\u0442\u0438\u0432 \u0441\u0443\u0434\u0435\u0431\u043d\u043e\u0433\u043e \u043f\u0440\u0435\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f \u043b\u0438\u0434\u0435\u0440\u0430 \u043f\u0430\u0440\u0442\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BB%D1%8C%D0%B2%D0%B8%D0%BE_%D0%91%D0%B5%D1%80%D0%BB%D1%83%D1%81%D0%BA%D0%BE%D0%BD%D0%B8\" class=\"mw-redirect\" title=\"\u0421\u0438\u043b\u044c\u0432\u0438\u043e \u0411\u0435\u0440\u043b\u0443\u0441\u043a\u043e\u043d\u0438\">\u0421\u0438\u043b\u044c\u0432\u0438\u043e \u0411\u0435\u0440\u043b\u0443\u0441\u043a\u043e\u043d\u0438<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u0432 \u043d\u0430\u0447\u0430\u043b\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c\u0443 \u043a\u0440\u0438\u0437\u0438\u0441\u0443 .<\/li><\/ul><h2>"}